INSERT INTO category ("id", "name", "description", "order", "is_active", "created_at") VALUES (1, 'Financial', 'Key financial responsibilities include presenting an acceptable annual budget, achieving consistent and diversified revenue growth, maintaining and improving profitability, ensuring positive returns on investments, managing cash flow, controlling costs, providing accurate and timely financial reports.', 1, TRUE, '2025-07-14T01:07:48.564446');
INSERT INTO category ("id", "name", "description", "order", "is_active", "created_at") VALUES (2, 'Strategy Development', 'Leads creation of AAAWCNY''s strategic direction and effectively implement long-term strategies that meet the needs of the organization, associates, members and other stakeholders.', 2, TRUE, '2025-07-14T01:07:48.564451');
INSERT INTO category ("id", "name", "description", "order", "is_active", "created_at") VALUES (3, 'Talent Development, Organizational Structure & Culture', 'Develops and leads a strong executive team to drive short and long-term results to meet strategic goals and make critical, timely decisions about acquisitions, mergers, product line expansions and personnel. Develops future leaders together with succession plans for long term succession and sudden loss of leadership. Creates a positive work environment for associates and promotes a culture reflecting AAAWCNY''s mission, values, and business strategies. Promotes organizational visibility and positive reputation in the communities served.', 3, TRUE, '2025-07-14T01:07:48.564454');
INSERT INTO category ("id", "name", "description", "order", "is_active", "created_at") VALUES (4, 'Operations', 'Oversees the efficient and effective operations of all departments and business lines ensuring positive operational performance and member satisfaction. Ensures adequate internal controls are in place and effectively assesses, manages and mitigates risk. Anticipates, assesses and responds to market trends and disruptions, risks, and opportunities that impact the success of AAAWCNY''s strategy. Creates successful marketing strategies that support the growth and diversification of revenues. Ensures that investments in technology (e.g. SalesForce, NetSuite) meet or exceed the ROI and related benefits set forth in the business cases presented to the Board for approval.', 4, TRUE, '2025-07-14T01:07:48.564455');
INSERT INTO category ("id", "name", "description", "order", "is_active", "created_at") VALUES (5, 'Board & External Relations', 'Forges collaborative, trusting, and transparent working relationships with the Board of Directors. Engages with the Board of Directors in establishing short-term objectives and long-term goals with regular updates on the status of operations. Works with the board and committee chairs to ensure meetings are productive. Demonstrates community leadership and actively engages with the business community.', 5, TRUE, '2025-07-14T01:07:48.564456');
