INSERT INTO assessment ("id", "officer_id", "reviewer_id", "year", "overall_rating", "accomplishments", "improvement_opportunities", "focus_for_next_year", "submitted_at", "is_self_assessment") VALUES (11, 2, 15, 2025, 4.2, NULL, NULL, NULL, '2025-07-17T14:17:11.798049', FALSE);
INSERT INTO assessment ("id", "officer_id", "reviewer_id", "year", "overall_rating", "accomplishments", "improvement_opportunities", "focus_for_next_year", "submitted_at", "is_self_assessment") VALUES (12, 10, 10, 2025, 4.0, 'Led the successful implementation of our new customer relationship management system, resulting in a 25% increase in customer retention rates. Spearheaded the digital transformation initiative that streamlined our operational processes, reducing processing time by 40%. Successfully managed a team of 15 professionals while maintaining high morale and productivity during challenging market conditions. Achieved all quarterly revenue targets and exceeded annual goals by 12%. Established strategic partnerships with three major industry players, opening new market opportunities worth $2.3M in potential revenue.', 'Need to improve delegation skills to better distribute workload among team members and avoid bottlenecks. Could enhance public speaking abilities for more effective board presentations and external stakeholder communications. Should develop stronger data analytics skills to make more informed strategic decisions. Time management could be optimized to balance strategic planning with day-to-day operational demands. Need to build deeper technical knowledge to better understand our technology infrastructure and make informed technology investment decisions.', 'Focus on developing next-generation leaders within my team through formal mentorship programs and leadership development initiatives. Expand market presence in the European region through strategic partnerships and direct investment. Implement advanced analytics capabilities to drive data-driven decision making across all departments. Strengthen our competitive position by investing in innovative product development and customer experience enhancements. Build a more resilient organizational structure that can adapt quickly to market changes and economic uncertainties.', '2025-07-17T01:15:00', TRUE);
INSERT INTO assessment ("id", "officer_id", "reviewer_id", "year", "overall_rating", "accomplishments", "improvement_opportunities", "focus_for_next_year", "submitted_at", "is_self_assessment") VALUES (13, 10, 3, 2025, 4.0, 'Emily has demonstrated exceptional leadership in driving our digital transformation initiative. Her strategic vision and execution capabilities resulted in significant operational improvements and cost savings. She effectively managed complex stakeholder relationships and maintained team morale during challenging transitions. Her financial acumen is evident in consistently exceeding revenue targets while optimizing costs. Emily has shown strong decision-making skills under pressure and maintains high ethical standards in all business dealings.', 'Emily should focus on developing stronger public communication skills for board presentations and external stakeholder meetings. Her tendency to get deeply involved in operational details sometimes prevents adequate delegation to team members. She could benefit from enhanced data analytics skills to support strategic decision-making. Time management could be improved to balance strategic planning with day-to-day operations. Building broader industry networks would enhance her external relations capabilities.', 'Recommend Emily lead our European expansion initiative, leveraging her strategic planning strengths. She should participate in advanced leadership development programs to enhance delegation and communication skills. Focus on building analytics capabilities within her team while developing her own technical competencies. Establish formal mentorship relationships with other executives to broaden her perspective. Consider board presentation training to strengthen her external communication effectiveness.', '2025-07-17T01:25:00', FALSE);
INSERT INTO assessment ("id", "officer_id", "reviewer_id", "year", "overall_rating", "accomplishments", "improvement_opportunities", "focus_for_next_year", "submitted_at", "is_self_assessment") VALUES (16, 10, 15, 2025, 4.0, 'Emily consistently delivers outstanding results across all key performance areas. Her leadership during the digital transformation was exemplary, showing both strategic vision and tactical execution. She has built a strong, cohesive team that performs at high levels while maintaining excellent morale. Emily''s financial management skills have resulted in consistent revenue growth and effective cost control. Her commitment to organizational values and ethical leadership sets a positive example for the entire company.', 'Emily would benefit from developing stronger presentation skills for board communications and external stakeholder engagements. While her operational knowledge is deep, she sometimes micromanages instead of delegating effectively. Her technical skills, while adequate, could be enhanced to better support strategic technology decisions. Emily could improve her work-life balance to sustain long-term performance and model healthy practices for her team.', 'Emily should take on greater responsibility for strategic planning and execution, particularly for new market development. She would benefit from executive coaching focused on presentation skills and delegation techniques. Consider assigning her to lead cross-functional initiatives to broaden her organizational perspective. Emily should participate in industry conferences and thought leadership activities to enhance external visibility and networking.', '2025-07-17T01:30:00', FALSE);
INSERT INTO assessment ("id", "officer_id", "reviewer_id", "year", "overall_rating", "accomplishments", "improvement_opportunities", "focus_for_next_year", "submitted_at", "is_self_assessment") VALUES (17, 10, 14, 2025, 3.0, 'Emily has made solid progress in her leadership role, particularly in operational improvements and team management. Her analytical approach to problem-solving has helped address several complex business challenges. She demonstrates good financial discipline and has maintained budget compliance while achieving most performance targets. Emily shows commitment to professional development and actively seeks feedback to improve her performance.', 'Emily needs to strengthen her strategic communication skills, especially when presenting complex information to board members and external stakeholders. Her decision-making process could be more decisive, as she sometimes over-analyzes situations. She should develop stronger delegation skills to avoid becoming a bottleneck in critical processes. Emily could benefit from enhanced technology leadership capabilities to better guide digital initiatives. Building stronger industry relationships would support long-term strategic objectives.', 'Emily should focus on developing executive presence through advanced communication training and board presentation skills. She would benefit from participating in strategic leadership programs to enhance her decision-making confidence. Consider assigning her to lead high-visibility cross-functional projects to build broader organizational perspective. Emily should engage more actively in industry associations and thought leadership activities to build external credibility and relationships.', '2025-07-17T01:40:00', FALSE);
INSERT INTO assessment ("id", "officer_id", "reviewer_id", "year", "overall_rating", "accomplishments", "improvement_opportunities", "focus_for_next_year", "submitted_at", "is_self_assessment") VALUES (18, 10, 4, 2025, 4.0, 'Emily has shown remarkable leadership throughout a challenging year, successfully navigating market uncertainties while maintaining team performance. Her strategic initiatives have yielded measurable results, particularly in operational efficiency and customer satisfaction. She demonstrates strong analytical skills and makes well-informed decisions based on comprehensive data analysis. Emily''s commitment to team development has resulted in improved retention rates and higher employee engagement scores.', 'Emily could enhance her external communication skills, particularly when presenting to industry stakeholders and potential partners. Her detail-oriented approach, while valuable, sometimes slows decision-making processes. She would benefit from developing stronger technology leadership skills to guide our digital transformation more effectively. Emily should focus on building broader industry relationships to support future growth initiatives.', 'Emily should lead our expansion into new market segments, leveraging her proven strategic planning abilities. She would benefit from advanced leadership training focused on stakeholder communication and technology strategy. Consider pairing her with a technology mentor to accelerate her digital leadership capabilities. Emily should represent the organization at key industry events to build external relationships and enhance our market presence.', '2025-07-17T01:35:00', FALSE);
